import React from "react";
import { motion } from "framer-motion";

const Card1 = () => {
  return (
    <div className="bg-white rounded-lg shadow-lg p-4 h-auto w-full overflow-hidden">

      <motion.div
        initial="hidden"
        whileInView="visible"
        variants={{
          visible: { opacity: 1 },
          hidden: { opacity: 0 },
        }}
        className="max-w-xl bg-white rounded-lg border border-gray-200 shadow-lg dark:bg-gray-800 dark:border-gray-700 my-8"
      >
        {/* Image container */}
        <div className="h-64 w-full overflow-hidden">
          <img
            src="https://wholeheartfamilymed.com/images/advanced-testing/metabolic/stop-diabetes.jpg"
            alt="Diabetes Prediction"
            className="w-full h-full object-cover rounded-t-lg"
          />
        </div>

        {/* Card content */}
        <div className="p-5">
          <a href="/Project1">
            <h5 className="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">
              Diabetes Disease Prediction
            </h5>
          </a>
          <p className="mb-3 font-normal text-gray-700 dark:text-gray-400">
            Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.
          </p>
          <a
            href="/project1"
            className="inline-flex items-center py-2 px-3 text-sm font-medium text-white bg-blue-500 rounded-lg hover:bg-blue-600 focus:ring-4 focus:outline-none focus:ring-blue-300"
          >
            Git
            <svg
              className="ml-2 -mr-1 w-4 h-4"
              fill="currentColor"
              viewBox="0 0 20 20"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                fillRule="evenodd"
                d="M10.293 3.293a1 1 0 011.414 0l6 6a1 1 0 010 1.414l-6 6a1 1 0 01-1.414-1.414L14.586 11H3a1 1 0 110-2h11.586l-4.293-4.293a1 1 0 010-1.414z"
                clipRule="evenodd"
              />
            </svg>
          </a>
        </div>
      </motion.div>

    </div>
  );
};

export default Card1;
